export default function a(t,a){let e=[...new Set(a.map(t=>Object.keys(t)).flat())];t.innerHTML=`\n        <thead class="table-head">\n            <tr class="table-row">\n                ${e.map(t=>`<th class="table-header">${t}</th>`).join("")}\n            </tr>\n        </thead>\n        <tbody class="table-body">\n        ${a.map(t=>`<tr class="table-row">\n                    ${e.map(a=>`<td class="table-cell">\n                                ${"object"==typeof t[a]?JSON.stringify(t[a]):null!=t[a]?t[a]:""}\n                                </td>`).join("")}<tr>`).join("")}\n    </tbody>\n    `};
